from django.test import TestCase

from backend.Service.UserService import nameedit, avataredit
from backend.models import User
import django.test.utils




class TestInfoEditService(TestCase):
    def setUp(self) -> None:
        User.objects.create(nickname='A', imagedata='',
                            imagemime='image/jpeg' )
        User.objects.create(nickname='B',
                            imagedata='',
                            imagemime='image/jpeg')

    def test_edit_nickname(self):
        data = nameedit(1, 'nick1')
        msg = data['msg']
        self.assertEqual('success', msg)

    def test_edit_not_exist_user_nickname(self):
        data = nameedit(3, 'nick3')
        msg = data['msg']
        self.assertEqual('fail', msg)

    def test_edit_avatar(self):
        data = avataredit(1, '',
                          'image/jpeg')
        msg = data['msg']
        self.assertEqual('success', msg)

    def test_edit_not_exist_user_avatar(self):
        data = avataredit(3, '',
               'image/jpeg')
        msg = data['msg']
        self.assertEqual('fail', msg)

